	int SoundIndex;
  int MusicIndex;
  int SoundSize;
  int MusicSize; 
  const uint8_t *SoundWave;
  const uint8_t *MusicWave;
 		
  void PlayNoise (void){
  	if (SoundIndex!=SoundSize&&SoundSize!=0){
			if(MusicSize!=0){
				DAC_Out(SoundWave[SoundIndex]*3/4+MusicWave[MusicIndex]*1/4);
				SoundIndex++;
				MusicIndex = (MusicIndex+1)%(MusicSize);
			}
			else{
				DAC_Out(SoundWave[SoundIndex]);
				SoundIndex++;
			}
  	}//sound playing
  	else if(MusicSize!=0){
  		DAC_Out(MusicWave[MusicIndex]);
  		MusicIndex = (MusicIndex+1)%(MusicSize); //increment index, and roll over when you get to end
  	}//music playing
  	else 
  		 NVIC_DIS0_R = 1<<19;           //disable interrupts IRQ 19 in NVIC 
  }
 
